"use strict";

function compareVersion(version1, version2) {
    let i = 0, j = 0, m = version1.length, n = version2.length;
    while (i < m || j < n) {
        let a = 0, b = 0;
        while (i < m && version1[i] !== '.') {
            a = a * 10 + parseInt(version1[i]);
            i++;
        }
        while (j < n && version2[j] !== '.') {
            b = b * 10 + parseInt(version2[j]);
            j++;
        }
        if (a !== b) {
            return a < b ? -1 : 1;
        }
        i++;
        j++;
    }
    return 0;
}
